defmodule UnirisCore.ReleaseTasks.NewWebsiteTransaction do
  @doc """
  Example of content hosting transaction trigger by a node
  and published into the network
  """
  alias UnirisCore.Transaction
  alias UnirisCore.TransactionData

  def run(index) do
    tx =
      Transaction.new(
        :transfer,
        %TransactionData{
          content: """
          <!DOCTYPE html>
          <html lang="en">
          <head>
              <meta charset="UTF-8">
              <meta name="viewport" content="width=device-width, initial-scale=1.0">
              <title>My wonderful website</title>
              <style>
              body {
                margin: 0;
              }
              nav header {
                background: #f5f5f5;
                display: flex;
                padding-left: 10px;
                flex-direction: row;
                align-items: center;
                padding-left: 10px;
              }

              nav ul li {
                display: inline-block;
              }

              section {
                padding-left: 10px;
              }

              article {
                display: flex;
              }

              article p {
                flex: 0.5
              }

              article img {
                flex: 0.5
              }

              form {
                display: flex;
                flex-direction: column;
                width: 500px;
              }
              </style>
          </head>
          <body>

              <nav>
              <header>
              <h1>ACME</h1>
                <ul>
                  <li><a href="#about_us">About us</a></li>
                  <li><a href="#contact">Contact</a></li>
                  <li><a href="#">New Page</a>
                  </ul>
                   </header>
              </nav>

            <section>
              <h2>Welcome !</h2>
              <article>
                <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.</p>
                <img src="data:image/jpeg;base64," alt="" />
                </article>
            </section>
            <section id="about_us">
              <header>
                <h2>About us!</h2>
              </header>
              <article>
                <img src="https://picsum.photos/seed/other/500/300" />
                <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.</p>
              </article>
            </section>
            <section id="contact">
              <header>
                <h2>Contact</h2>
              </header>
              <form>
                <input type="email" placeholder="enter your email" />
                <textarea placeholder="type your message here"></textarea>
                <button>
                 Send us a message
                </button>
              </form>
            </section>
          </body>
          </html>
          """
        },
        "seed",
        index
      )

    UnirisCore.send_new_transaction(tx)
  end
end
